import styled from 'styled-components';

const Section = styled.div`
  padding: 16px;
`;

const Container = styled.div`
  padding: 16px;
  margin-top: 16px;
`;

const Action = styled.div`
  display: flex;
  -webkit-box-align: center;
  align-items: center;
`;

const Inheader = styled.div``;

const Issueheader = styled.h2``;

const Searchblock = styled.div`
  padding: 8px 16px;
  display: flex;
  width: 100%;
`;

const Searchtext = styled.div`
  border-radius: 6px;
  border: 1px solid rgb(225, 228, 232);

  .text-field-container {
    width: 100%;
  }
`;

const Searchinput = styled.input`
  padding: 8px;
  border: none;
  outline: none;
  background: none;
  font-size: 1rem;
  width: 100%;
`;

const ActionButtons = styled.div`
  display: flex;
`;

const Newbutton = styled.a`
  cursor: pointer;
  display: block;
  width: 100%;
  text-align: center;
  padding: 4px 16px;
  margin: 4px;
  min-width: 100px;
  border-radius: 6px;
  color: white;
  font-size: 1rem;
  background: rgb(66, 195, 96);
  border-bottom: 2px solid rgb(40, 167, 69);
`;

function Issue() {
  return (
    <Section>
      <Container>
        <Action>
          <Inheader>
            <Issueheader>Issue</Issueheader>
            <Searchblock>
              <Searchtext>
                <Searchinput
                  type="input"
                  placeholder="issue名で検索"
                  className="text-field-container"
                />
              </Searchtext>
            </Searchblock>
            <ActionButtons>
              <Newbutton>New</Newbutton>
            </ActionButtons>
          </Inheader>
        </Action>
      </Container>
    </Section>
  );
}

export default Issue;
